import Navbar from './Navbar/Navbar';
import Home from './Home/Home';
import { Route } from 'react-router-dom';

function App() {
  return (
    <div>
      <Navbar />
      <Route path='/Home' render={() => <Home />} />
    </div>
  );
}

export default App;
